import React from 'react'

class LogInForm extends React.Component {

   render(){
      return (
         <form className="login-form">
            <label className="title">Log in</label>
            Username:
            <input type="text"/>
            Password:
            <input type="text"/>
         </form>
      )
   }
}

export default LogInForm
